import React from "react";
import { useState } from "react";

const UserProfile = () =>{
    const [getPhoto, setPhoto] = useState('https://images.pexels.com/photos/45201/kitty-cat-kitten-pet-45201.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500')
    function changePh(){
        setPhoto('https://www.rd.com/wp-content/uploads/2021/04/GettyImages-988013222-scaled-e1618857975729.jpg')
    }

    return (
        <div>
            <img style ={{height: '200px'}}src={getPhoto} alt="" />
            <button onClick = {changePh} >Change Photo</button>
        </div>
    )
}
export default UserProfile
